import React from 'react';

const SideBar = () => {
  return (
    <div classN="dropdown">
      <img src="/images/SideBar.png" alt=""/>
      <div className="dropdown-menu">
        <a href="#">Link 1</a>
        <a href="#">Link 2</a>
        <a href="#">Link 3</a>
    </div>
    </div>
  );
};

export default SideBar;
